import React from "react";
import { Button } from "@material-ui/core";

class Main extends React.Component {
  render() {
    const style = {
      textAlign: "center",
      backgroundColor: "#000",
      color: "#b02705",
      width: 250,
      border: "#b02705",
      padding: 5,
      margin: 3,
      display: "block",
      float: "left",
    };

    return (
      <div className="Movie-names" style={style}>
        <img src={this.props.movie.imgUrl} width="250" height="150" alt="" />
        <h3 style={{ fontFamily: "Balsamiq Sans" }}>{this.props.movie.name}</h3>
        <p style={{ fontFamily: "serif" }}>Date :{this.props.movie.date} </p>
        <Button color="success">
          <a
            href={this.props.movie.Trailer}
            target="_blank"
            rel="noopener noreferrer"
          >
            Watch Trailer
          </a>
        </Button>
      </div>
    );
  }
}
export default Main;
